window.bookSummaryJSON = "<p>For Noah Vines, death isn't the end. It's a weapon.</p> <p>After standing around in the afterlife for thousands of years, Noah is all out of patience. When the opportunity to steal a second chance at living arises, he doesn’t hesitate.</p> <p>Reincarnated into the body of a dying magic school professor, Noah finds that he took more than just a second chance. He got infinite. Every time he dies, his body reforms.</p> <p>Lives are a currency, and Noah Vines is rich.</p> <p>With countless variations of runic magic to discover and with death serving as only a painful soul-wound rather than a final end, Noah finally has a chance to wander the lands of the living once more.</p> <p>This time around, he plans to get strong enough to make sure that he never has to wait around in the afterlife again.</p> <p>Don't miss the next hit Progression Fantasy series from Actus, bestselling author of My Best Friend is an Eldritch Horror. Featuring a strong, intelligent protagonist, a detailed runic magic system, loads of power progression, and so much more.</p> <p>With nearly 10 million views as a webserial, you can experience the definitive version of this smash-hit series on Kindle, Kindle Unlimited, and Audible!</p>"; 
